  "text" : "「フリーライセンスでの提供は、契約の一種であり、その契約は、再利用される時点で結ばれるとみなされる」というのをどこかで読んだか聞いたかした覚えがあるのだけど、そうなると「契約の破棄」に関するどうこう・・・っていう問題になるのだろうか。 #jawp [lab]",
