  "text" : "「犯行の方法なんて論理的に考えれば誰にだって分かるが、犯人が犯行に及んだ理由なんて絶対に分からない」というのは、確か帝丹高校学園祭の劇の事件で新一が戻ったときに言ったセリフだったかな。 [lab]",
