  "id_str" : "16910499713",
  "text" : "金田一とコナンの大きな違いは、犯人の動機の描写の仕方。金田一は、謎とき後に犯人による動機語りがけっこう長くあるけど、コナンは謎とき後はあっさり。これは多分、剛昌さん（つまりコナン）の信条として「犯行の動機なんて、どうやったって理解できない」というのがあるのだと思う。 [lab]",
